import './App.css';
import Navbar from './NavBar/Navbar';
import Card from './Card/Card';
import BottomCard from './Card/BottomCard';
import Footer from './Footer/Footer';

function App() {
  return (
    <div className="App">
     <Navbar/>
     <Card/>
     <BottomCard/>
     <Footer/>
    </div>
  );
}

export default App;
